import "./ExpenseItem.css";

function ExpenseItem() {
  const expenseDate = new Date(2023, 1, 2);
  const expenseTitle = "Campus";
  const expensePack = 450000;

  return (
    <div className="expense-item">
      <div> {expenseDate.toISOString()} </div>
      <div className="expense__description">
        <h1> {expenseTitle} </h1>
      </div>
      <div className="expense-item__price"> {expensePack} </div>
    </div>
  );
}

export default ExpenseItem;
